import React from 'react';

import './Home.css';
import Header from '../../components/Header/Header';


import Cap from '../../Img/fruitshome.jpg'
import Eco from '../../Img/eco.jpg'



const Home = () => {
    return (
        <div id='content-home'>
            <Header/>
            <div className="first-img">
                <img className="image-cap" src={Cap} alt="image-cap"/> 
                <div className="title">LA HUERTA DE MARIAN</div>
                <div><img className="image-eco" src={Eco} alt="huerta-ecologica"/> </div>
            </div>
        </div>
    )
};

export default Home;
